syntax = "proto3";

package netools.app.dispatcher;
option csharp_namespace = "Netools.App.Dispatcher";
option go_package = "github.com/gptlocal/netools/app/dispatcher";
option java_package = "net.localgpt.netools.app.dispatcher";
option java_multiple_files = true;

message SessionConfig {
  reserved 1;
}

message Config {
  SessionConfig settings = 1;
}
